import { StyleSheet } from 'aphrodite/no-important'

export default StyleSheet.create({
  name: {
    paddingBottom: 3,
    fontSize: 16,
    fontWeight: 600
  },
  crown: {
    height: 13,
    width: 'auto !important',
    color: '#af5f0c',
    margin: '0 6px 10px'
  }
})
